        decide = condition == 'cleany' ?
        DATA600.map((item) => {
            return (
                <ProductRow
                    image={item.img}
                    title={item.title}
                    bottle={item.bottle}
                    price={item.price}
                />
            );
        })
            :
            NDATA600.map((item) => {
                return (
                    <ProductRow
                        image={item.img}
                        title={item.title}
                        bottle={item.bottle}
                        price={item.price}
                    />
