                        bottle={item.bottle}
                        price={item.price}
                    />
                );
            })
            :
            NDATA500.map((item) => {
                return (
                    <ProductRow
                        image={item.img}
                        title={item.title}
                        bottle={item.bottle}
                        price={item.price}
                    />
                );
            })
    } else if (sqft > 350 && sqft <= 450) {
        decide = condition == 'cleany' ?
            DATA450.map((item) => {
                return (
                    <ProductRow
                        image={item.img}
                        title={item.title}
                        bottle={item.bottle}
                        price={item.price}
                    />
                );
            })
            :
            NDATA450.map((item) => {
                return (
                    <ProductRow
                        image={item.img}
