            })
    } else if (sqft > 300 && sqft <= 350) {
        decide = condition == 'cleany' ?
            DATA350.map((item) => {
                return (
                    <ProductRow
                        image={item.img}
                        title={item.title}
                        bottle={item.bottle}
                        price={item.price}
                    />
                );
            })
            :
            NDATA350.map((item) => {
                return (
                    <ProductRow
                        image={item.img}
                        title={item.title}
                        bottle={item.bottle}
                        price={item.price}
                    />
                );
            })

    } else if (sqft > 250 && sqft <= 300) {
        decide = condition == 'cleany' ?
            DATA300.map((item) => {
                return (
                    <ProductRow
                        image={item.img}
                        title={item.title}
                        bottle={item.bottle}
                        price={item.price}
                    />
                );
            })
            :
            NDATA300.map((item) => {
                return (
                    <ProductRow
                        image={item.img}
                        title={item.title}
                        bottle={item.bottle}
                        price={item.price}
                    />
                );
            })

