            NDATA250.map((item) => {
                return (
                    <ProductRow
                        image={item.img}
                        title={item.title}
                        bottle={item.bottle}
                        price={item.price}
                    />
                );
            })
    } else {
        decide = condition == 'cleany' ?
            DATA200.map((item) => {
                return (
                    <ProductRow
                        image={item.img}
