        discountDecide = condition == 'cleany' ? DATA450T.map((item) => item.discount) : NDATA450T.map((item) => item.discount)
        totalDecide = condition == 'cleany' ? DATA450T.map((item) => item.total) : NDATA450T.map((item) => item.total)
       
